import React, { useEffect, useState } from 'react';
import { useHistory } from 'react-router-dom';

export default function Home() {
  const history = useHistory();
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    color: '',
    size: ''
  });

  const handleFormSubmit = (e) => {
    e.preventDefault();
    const { name, age, color, size } = formData;
    // Navegar para a rota de resultados filtrados com base nos valores selecionados
    history.push(`/filtered-results/${name}/${age}/${color}/${size}`);
  };

  return (
    <div>
      <h2>Home</h2>
      <form onSubmit={handleFormSubmit}>
        <label>
          Apelido:
          <input type="text" name="name" value={formData.name} onChange={(e) => setFormData({ ...formData, name: e.target.value })} />
        </label>
        <label>
          Idade:
          <input type="text" name="age" value={formData.age} onChange={(e) => setFormData({ ...formData, age: e.target.value })} />
        </label>
        <label>
          Cor:
          <input type="text" name="color" value={formData.color} onChange={(e) => setFormData({ ...formData, color: e.target.value })} />
        </label>
        <label>
          Tamanho:
          <input type="text" name="size" value={formData.size} onChange={(e) => setFormData({ ...formData, size: e.target.value })} />
        </label>
        <button type="submit">Salvar</button>
      </form>
    </div>
  );
}
